import React from 'react';
import ReactDOM from 'react-dom';
import './style.sass';
import openSocket from 'socket.io-client';


class Camera extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      img: null
    }
  }

  getData() {
    fetch('frame.txt')
    .then((response) => {
      console.log(response.text());
      // return response.text();
      this.setState({
        img: 'https://kopernik.kalisz.pl/wp-content/themes/koperniktheme/assets/rm-icons/kopernik_mq.png'
      });
    });
  }

  render() {
    return (
      <div>
        <img src={ this.state.img } alt="ROV camera output"/>
      </div>
    );
  }
}

// ========================================

// const io = openSocket('http://localhost:3000');

ReactDOM.render(
  <Camera />,
  document.getElementById('root')
);
